import React from 'react';
import {Link} from 'react-router-dom';
import { Button } from 'react-bulma-components';
import { Field, Control, Label, Input, Textarea, Select, Checkbox, Radio, Help, InputFile } from 'react-bulma-components/lib/components/form';

export default function MainSearch() {
    return (

        <div>
            <Field>
                <Input placeholder="Search for cards..."/>
            </Field>


            <input type="search" className="main-search-bar" placeholder="Search for cards.."></input>
            <Link to="/cardDisplay">
                <Button color="primary" outlined rounded size ="small">
                    search
                </Button>
            </Link>
            
        </div> 
    )   
}
